import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from "../components/NavBar";
import '../styles/Registers.css';

const RegisterProduct = () => {
    const [formData, setFormData] = useState({
        descripcion: '',
        costo: '',
        peso: '',
        margen_ganancia: '',
        cantidad: '',
        id_categoria: '',
        id_material: ''
    });

    const navigate = useNavigate();
    const [message, setMessage] = useState('');

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        const response = await fetch('http://localhost:3000/producto', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(formData)
        });

        const result = await response.json();
        setMessage(result.message);
        if (response.ok) {
          navigate('/dashboard'); 
        }
    };

    return (
        <div>
          <Navbar />
          <div className="backgroundRP">
            <div className="containerRM">
              <h2>Registrar Producto</h2>
              <form id="datos" onSubmit={handleSubmit}>
                <div className="form_controlRM">
                  <label htmlFor="descripcion">Descripción:</label>
                  <input
                    type="text"
                    id="descripcion"
                    name="descripcion"
                    value={formData.descripcion}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <div className="form_controlRM">
                  <label htmlFor="costo">Costo:</label>
                  <input
                    type="number"
                    id="costo"
                    name="costo"
                    value={formData.costo}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <div className="form_controlRM">
                  <label htmlFor="peso">Peso:</label>
                  <input
                    type="number"
                    id="peso"
                    name="peso"
                    value={formData.peso}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <div className="form_controlRM">
                  <label htmlFor="margen_ganancia">Margen de Ganancia:</label>
                  <input
                    type="number"
                    id="margen_ganancia"
                    name="margen_ganancia"
                    value={formData.margen_ganancia}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <div className="form_controlRM">
                  <label htmlFor="cantidad">Cantidad:</label>
                  <input
                    type="number"
                    id="cantidad"
                    name="cantidad"
                    value={formData.cantidad}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <div className="form_controlRM">
                  <label htmlFor="id_categoria">Categoría:</label>
                  <input
                    type="text"
                    id="id_categoria"
                    name="id_categoria"
                    value={formData.id_categoria}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <div className="form_controlRM">
                  <label htmlFor="id_material">Material:</label>
                  <input
                    type="text"
                    id="id_material"
                    name="id_material"
                    value={formData.id_material}
                    onChange={handleInputChange}
                    required
                  />
                </div>
                <button className="btn-submit">Registrar Producto</button>
                {message && <p>{message}</p>}
              </form>
            </div>
          </div>
        </div>
      );
      };

export default RegisterProduct;
